import React from "react";
import Header from "../components/Header";

export default class TopicFeeder extends React.Component {
  state = {
    topics: []
  };

  render() {
    return (
      <>
        <header>
          <Header user={this.props.user} />
        </header>
        <main>
          <ul></ul>
        </main>
      </>
    );
  }

  componentDidMount() {
    api.fetchTopics().then(topics => {
      this.setState({ topics: topics });
    });
  }
}
